    false,nt"url": null,nt"notes": "This digital data set consists of specific
    yield percentage contours and polygons for the High Plains aquifer in the central
    United States. The High Plains aquifer extends from south of 32 degrees to almost
    44 degrees north latitude and from 96 degrees 30 minutes to almost 106 degrees west
    longitude. The outcrop area covers 174,000 square miles and is present in Colorado,
    Kansas, Nebraska, New Mexico, Oklahoma, Texas, South Dakota, and Wyoming. This digital
    data set was created by digitizing the specific yield percentage contours from a
    1:1,000,000 base map created by the U.S. Geological Survey High Plains Regional
    Aquifer-System Analysis (RASA) project (Gutentag, E.D., Heimes, F.J., Krothe, N.C.,
    Luckey, R.R., and Weeks, J.B., 1984, Geohydrology of the High Plains aquifer in
    parts of Colorado, Kansas, Nebraska, New Mexico, Oklahoma, South Dakota, Texas,
    and Wyoming: U.S. Geological Survey Professional Paper 1400-B, 63 p.) The data should
    not be used at scales larger than 1:1,000,000.",nt"license_title": null,nt"extras":
